"<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt; font-weight:600;\">UYGULAMAYA HOSGELDINIZ</span></p>\n"
"<p align=\"center\" style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt; font-weight:600;\">Uygulama Hakkinda Bilgi Edindemk icin Asagida Yer Alan Bilgilendirme Metnini Okuyunuz !!!</span></p>\n"
"<p align=\"center\" style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'MS Shell Dlg 2\'; font-size:11pt; font-weight:600;\"><br /></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">1- Uygulama Icerisinde Etiketleme Sekmesine Tklayarak Islemlerinizi Gecreklestireceginiz Sayfaya Ulasiniz.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">2- Acilan Sayfa Icerisinde Eger Kamerayi Goruntulemek Isterseniz; Oncelikle Yenile Butonuna Basarak Sisteminizde Mevcut Durumdaki Kmareleri Camera List Icerisinde Goruntuleyebilirsiniz. Eger Yeni kamera Ekeleme veya Kamera Cikarma Durumlarinda Butona Basarak Listenizi Yenileyebilirsiniz.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">3- Kamerayi Sectikten Sonra Baslat butonna Basarak Kameranizi Aktiflestirerek Kamera Goruntusu Ekraninda Goruntuleyebilirsiniz. </span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">4- Yakala Konum buyonu ile Bilgisayarinizdan Yakalayacaginiz Goruntulerin Kaydedileceigi Konumu Secmelisiniz.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">5- Goruntu Ekranda Ilerleyen Durumda Iken Yakala Butonu Ile Akan Goruntu Uzerinen Bir Resim Yakalanir ve Oncesinde Sectigimiz Konuma Kaydedilir.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">6- Dilerseniz Kamerayi Kapat Butonuna Basarak Kapatabilirsiniz.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">7- Yukle Butonuna Basarak Kamranizdan Aldiginiz Goruntulerin yada Farkli Dosyada Yer Alan Resim Formatindaki Goruntuler Liste Icerisnde ve Etiket Ekraninda Goruntulenecektir.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">8- Goruntuleri Liste Icerisinden yada Sonraki Butonuna Basarak Ilerletebilirsiniz.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">9- Alt Menu Butonuna Basarak Alt Menuyu goruntuleyebilirsiniz.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">10- Genislik Yukseklik Ve Aci Degerlerini Girdikten Sonra Kare Olustur Butonuna Basarak Kareniz Goruntu Uzerine Eklenecektir.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">11- Eklenen Kareyi Mause ile Hareket Ettirebilirsiniz.</span></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\">12- Silmek Istediginiz Kareye Sag Tik Yaparak Acilan Menuden Sil Butonuna Basabilirsiniz.</span></p>\n"
"<p style=\"-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'MS Shell Dlg 2\'; font-size:11pt;\"><br /></p>\n"
"<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt; font-weight:600;\">!!!!</span><span style=\" font-family:\'MS Shell Dlg 2\'; font-size:11pt;\"> Kamreanin Acilmasi Sitemin ve Kamrenin Ozelliklerine Bagli Olarak 3 - 10 saniye Arasinda Degismektedir. --&gt; Lutfen Islemlerinizde Goz Onune Aliniz.</span></p>\n"
